import React from "react";
import {observer} from 'mobx-react-lite'
import { Flex, Text, Image } from "@chakra-ui/react";


const Header: React.FC = () =>{
  return (
    <Flex
        w="100%"
        h="60px"
        top="0"
        align="center"
        justify="center"
        position="relative"
    >
      <Text

      >
        StartMovies
      </Text>
    </Flex>
  );
}

export default observer(Header)
